import React, { Component } from "react";
import "./Pizza.css";
import "bootstrap/dist/css/bootstrap.min.css";

import BnpChatbot from "../chatbot/BnpChatbot";

class Pizza extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tomato: false,
      mushroom: false,
      veggie: false,
      corn: false
    };
  }



  render() {


    return (
      <div>
          <BnpChatbot />
        </div>
    );
  }
}

export default Pizza;
